import { useState } from "react";

function App() {
  const [popup, setPopup] = useState(false);

  const handleClick = () => {
    setPopup(!popup);
  };

  return (
    <div id="container">
      <h1>The Last Show</h1>

      <button id="popup" onClick={handleClick}>
        + New Obituary
      </button>

      {popup && (
        <div id="popup-container">
          <p>Example text in the popup!</p>
        </div>
      )}
    </div>
  );
}

export default App;
